import {
    BrowserRouter as Router,
    Switch,
    Route,
    useParams
  } from "react-router-dom";
import App from '../App';
  
class WebsiteRouter extends Component {
    render() {
      return (
        <React.Fragment>
            <Router>
        <Switch>
        <Route exact path="/">
            <App />
        </Route>
        <Route path="/signin">
            <SignIn/>
        </Route>
            </Switch>
        </Router>
        </React.Fragment>
      );
    }
  }
  export default WebsiteRouter;
